import React from 'react'

function Squads() {
    const squad = [{
        team:"Chennai Super Kings",
        players:[{
            name:"Murali Vijay",
            role:"Batsman"
        },
        {
            name:"Dhoni",
            role:"Wicket Keeper"
        },
        {
            name:"Dwayne Bravo",
            role:"All Rounder"
        },
        {
            name:"Imran Tahir",
            role:"Bowler"
        }
    ]
    }]
    return (
        <div className="w3-container mt-3">
            {
                squad.map((data,index)=>{
                    return(
                        <div>
                            <p>{data.team}</p>
                            <hr />
                        </div>
                    )
                })
            }
        </div>
    )
}

export default Squads
